// SPDX-License-Identifier: MIT
pragma solidity 0.8.23;
import "hardhat/console.sol";
contract L1SLOADmock {
    mapping (address => mapping (uint256 => bytes)) public mockedSlots;

    constructor () {
    }

    function decodeInput(bytes calldata data) public pure returns (address, uint256) {
        return  (address(uint160(uint256(bytes32(data[:20])))), uint256(bytes32(data[20:52])));

    }

    function hashMappingSlot(uint256 key,uint256 slotNumber) public pure returns(bytes32) {
        return keccak256(abi.encodePacked(key,slotNumber));
    }

    function setMockedSlot(address l1ContactAddr, uint256 slot, bytes calldata value) public {
        mockedSlots[l1ContactAddr][slot] = value;
    }

    function readMockedSlot(address _l1ContactAddr, uint256 _slot) public view returns ( bytes memory) {
        bytes memory data = abi.encodePacked(_l1ContactAddr, _slot);
        address l1ContactAddr;
        uint256 slot;
        (l1ContactAddr, slot) = this.decodeInput(data);
        bytes memory value = mockedSlots[_l1ContactAddr][slot];
        return value;
    }

    // mimics L1_SLOAD_ADDRESS.staticcall(input) at ToadnadoL2
    fallback(bytes calldata data) external returns (bytes memory) {
        console.logBytes(data);
        address l1ContactAddr;
        uint256 slot;
        (l1ContactAddr, slot) = decodeInput(data);
        return  mockedSlots[l1ContactAddr][slot];
    }

    function hii() public pure returns(uint256) {
        return 420;
    }

}

